DROP TABLE IF EXISTS `dbc_Talent`;
CREATE TABLE `dbc_Talent` (
	`ID` INT NOT NULL DEFAULT '0',
	`TalentTab` INT NOT NULL DEFAULT '0',
	`tierId` INT NOT NULL DEFAULT '0',
	`columnIndex` INT NOT NULL DEFAULT '0',
	`spellRank1` INT NOT NULL DEFAULT '0',
	`spellRank2` INT NOT NULL DEFAULT '0',
	`spellRank3` INT NOT NULL DEFAULT '0',
	`spellRank4` INT NOT NULL DEFAULT '0',
	`spellRank5` INT NOT NULL DEFAULT '0',
	`spellRank6` TEXT NOT NULL,
	`spellRank7` TEXT NOT NULL,
	`spellRank8` TEXT NOT NULL,
	`spellRank9` TEXT NOT NULL,
	`prereqTalent1` INT NOT NULL DEFAULT '0',
	`prereqTalent2` TEXT NOT NULL,
	`prereqTalent3` TEXT NOT NULL,
	`prereqRank1` INT NOT NULL DEFAULT '0',
	`prereqRank2` TEXT NOT NULL,
	`prereqRank3` TEXT NOT NULL,
	`flags` INT NOT NULL DEFAULT '0',
	`requiredspellId` INT NOT NULL DEFAULT '0')
 ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_general_ci COMMENT='Export of Talent';
 SET NAMES UTF8;

